import React from 'react';
import '../styles/Navbar.css';

const Navbar = () => {

    return (
        <div classname='navbar'>
            <h3>
                Arena Deck Builder
            </h3>
            <h3>
                Card List
            </h3>
            <h3>
                Deck Builder
            </h3>
        </div>)
    ;
};

export default Navbar;
